import React from 'react'

export const SidebarData = [
    {
        title: 'Home',
        path: '/',
        icon: <i class="fas fa-home"></i>,
        cName: 'nav-text'
    },
    {
        title: 'Selection sort',
        path: '/reports',
        icon: <i class="fas fa-sort-amount-up-alt"></i>,
        cName: 'nav-text'
    },
    {
        title: 'Test',
        path: '/products',
        icon: <i class="fas fa-home"></i>,
        cName: 'nav-text'
    }
]
